pragma solidity ^0.4.20;

import './NotaryMaps.sol';
import './RoomBasic.sol';
import './LibContract.sol';

contract Notary is LibContract{
    using NotaryMaps for NotaryMaps.MapAddr2Notary;

    address owner;
    uint constant MARGIN_THRESHOLD_NOTARY  = 100;    // Inter至少抵押数量

    event Register(address addr, string nodeid, uint amount);
    event ApplyForLock(address addr, uint locktime);
    event UnRegister(address addr, string nodeid, uint amount);
    event ApplyNotory(address tableManage,uint256 tableid, address player, uint number);
    event ApplyForNotory(address roomAddr, uint tableId, uint number);
    event ReNotory(address tableManage,uint256 tableid, uint8 retCode, uint number);  // 重新公证
    event ResetNotarize(address roomAddr, uint tableId);

    enum NreStatus {
        SUCCESS,                // 成功
        APP_NUM_LESS_THAN_0,    // 申请公证个数小于等于０
        NR_INSUFFICIENT         // 可用公证者个数不够
    }

    struct NotaryStatus {
        uint8 status;   // 0:ok;1:失效
        address addr;   // 公证者地址
    }

    NotaryMaps.MapAddr2Notary addr2notarys;

    //address public roomMgrAddr;            // RoomManager合约地址
    //address public tableMgrAddr;    // TableManager合约地址
    mapping(address => bool) games;

    mapping(address => mapping(uint256 => address[]))   table2notarys;       // table地址 -- tableid=>选择的notary地址
    mapping(address => mapping(uint256 => uint))        table2nrnumber;     // table地址 -- tableid=>选择的notary数量
    mapping(address => mapping(uint256 => NotaryStatus[]))   table2nrs;     // table地址 -- tableid=>选择的notary的状态

    mapping(address => mapping(uint => address[]))  room2tbNrAddr;      // room地址 -- (tableId -- 公证者地址) 正在使用
    //mapping(address => mapping(uint => address[]))  room2tbNrAddr_I;    // room地址 -- (tableId -- 公证者地址) 已异常
    mapping(address => mapping(uint => uint))       room2tbNrNum;       // room地址 -- table选择的notary数量
    mapping (address => mapping(uint => uint))      room2tbappTime;     // room地址 -- (table号码--申请公证时间)

    mapping(address => uint) nrAddr2failCout;   // 公证者地址 -- 公证异常次数
    mapping(address => uint) nrAddr2SuccCout;   // 公证者地址 -- 公证者成功次数

    constructor() public {
        owner = msg.sender;
        _setContract("NotaryManager",this); //注册合约到模块
    }

    function() public payable {
    }

    function setTableMgr(address tableMgr) public {
        assert(msg.sender == owner);
        //tableMgrAddr = tableMgr;
        games[tableMgr]=true;
    }

    // function getTableMgr() public view returns(address) {
    //     return tableMgrAddr;
    // }

    function setRoomMgrAddr(address roomMgr) public {
        assert(msg.sender == owner);
        //roomMgrAddr = roomMgr;
        games[roomMgr]=true;
    }

    // function getRoomMgrAddr() public view returns(address) {
    //     return roomMgrAddr;
    // }

     /**
     * @dev 获取已注册notary的数量
     */
    function numberOfNotary() public view returns (uint) {
        return addr2notarys.size();
    }

    /**
     * @dev 获取未锁定notary的数量
     */
    function numberOfUnlockNotary() public view returns (uint) {
        uint total = addr2notarys.size();

        uint number = 0;
        for(uint i = 0; i < total; i++) {
            if(0 == addr2notarys.getValueByIndex(i).locktime) {
                number++;
            }
        }

        return number;
    }

    /**
     * @dev 注册notary
     * @param nodeid notary的node id
     */
    function register(string nodeid) public payable returns (bool) {
        uint amount = msg.value;    // 获取抵押金额

        address addr = msg.sender;
        if(!addr2notarys.contains(addr)) {
            require(amount >= MARGIN_THRESHOLD_NOTARY, "Insufficient amount of mortgage");
        }
        else {
            amount += addr2notarys.getValueByKey(addr).pawnAmount;
        }

        NotaryMaps.NotaryInfo memory notaryinfo = NotaryMaps.NotaryInfo(addr, nodeid, amount, 0);
        addr2notarys.insert(addr, notaryinfo);

        emit Register(addr, nodeid, amount);
        return true;
    }

    /**
     * @dev 给table申请公证者
     */
    function applyNotorys(uint tableId, address playerAddr,uint number) public returns(string) {
        address roomAddr = msg.sender;
        if(!games[msg.sender]) {
            return "非法的tableid player";
        }

        uint i;
        bool flg;

        if(room2tbNrAddr[roomAddr][tableId].length != 0){
            return "已申请公证者";
        }
        if(number == 0){
            return "申请数量不能为0";
        }

        uint notaryNum = numberOfNotary(); 
        if(number > numberOfUnlockNotary()){
            return "没有足够的公证者";
        }

        uint8[] memory selected = new uint8[](notaryNum);
        for(i = 0; i < notaryNum; i++) {
            selected[i] = 0;
        }

        uint selectedNum = number;

        uint index;
        uint seed = uint(msg.sender);
        while(number > 0) {
            seed = uint(sha256(block.difficulty, now, seed));
            index = seed % notaryNum;
            while(1 == selected[index] || 0 != addr2notarys.getValueByIndex(index).locktime) {
                index = (index + 1) % notaryNum;
            }

            address tmpAddr = addr2notarys.getKeyByIndex(index);
            number--;
            selected[index] = 1;
            room2tbNrAddr[roomAddr][tableId].push(addr2notarys.getKeyByIndex(index));
        }

        room2tbNrNum[roomAddr][tableId] = selectedNum;

        room2tbappTime[roomAddr][tableId] = block.number;
        emit ApplyNotory(msg.sender,tableId, playerAddr, selectedNum);
        return "";
    }



    /**
     * @dev 给table申请公证者
     * @param roomAddr  游戏房间地址
     * @param tableId   Table的ID
     * @param number    分配notary的个数
     */
    function reApplyForNotorys(address roomAddr, uint tableId, uint number) public returns(bool){
        require(room2tbappTime[roomAddr][tableId] != 0);
        require(block.number - room2tbappTime[roomAddr][tableId] >= 120);

        //RoomBasic(roomAddr).resetNotoryInfo(tableId);

        address playerAddr = msg.sender;

        if(!games[msg.sender]) {
            return false;
        }

        uint i;
        bool flg;

        require(room2tbNrAddr[roomAddr][tableId].length == 0);
        require(number > 0);
        uint notaryNum = numberOfNotary();
        require(number <= numberOfUnlockNotary());

        uint8[] memory selected = new uint8[](notaryNum);
        for(i = 0; i < notaryNum; i++) {
            selected[i] = 0;
        }

        uint selectedNum = number;

        uint index;
        uint seed = uint(msg.sender);
        while(number > 0) {
            seed = uint(sha256(block.difficulty, now, seed));
            index = seed % notaryNum;
            while(1 == selected[index] || 0 != addr2notarys.getValueByIndex(index).locktime) {
                index = (index + 1) % notaryNum;
            }

            address tmpAddr = addr2notarys.getKeyByIndex(index);
            number--;
            selected[index] = 1;
            room2tbNrAddr[roomAddr][tableId].push(addr2notarys.getKeyByIndex(index));
        }

        room2tbNrNum[roomAddr][tableId] = selectedNum;

        room2tbappTime[roomAddr][tableId] = block.number;
        emit ApplyForNotory(roomAddr, tableId, selectedNum);
        return true;
    }



    /**
     * @dev 汇报公证者异常
     * @param roomAddr  游戏房间地址
     * @param tableId   Table的ID
     * @param nrAddr    公证者地址
     */
    function reportFailNorary(address roomAddr, uint tableId, address nrAddr) public {
        //

        // nrAddr2failCout[nrAddr]++;
        // for(uint i = 0; i < room2tbNrs[roomAddr][tableId].length; i++) {
        //     if(nrAddr == room2tbNrAddr_I[roomAddr][tableId][i].addr) {
        //         room2tbNrs[roomAddr][tableId][i].status = 1;  // 设置为失效
        //         break;
        //     }
        // }
    }
    //table重新申请公证
    function reNotarize(uint256 tableid) public returns(bool){
        var number = room2tbNrAddr[msg.sender][tableid].length;
        return reApplyForNotorys(msg.sender,tableid,number);
    }

    function finishNotarize(uint256 tableid) public {
        resetNotarize(msg.sender,tableid);
    }

    function resetNotarize(address roomAddr, uint tableId) public {
        require(msg.sender == roomAddr);

        if(!games[msg.sender]) {
            return;
        }

        uint i;

        delete room2tbNrNum[roomAddr][tableId];
        room2tbNrNum[roomAddr][tableId] = 0;

        // for(i = 0; i < room2tbNrs[roomAddr][tableId].length; i++) {
        //     delete room2tbNrs[roomAddr][tableId][i].status;
        //     delete room2tbNrs[roomAddr][tableId][i].addr;
        //     delete room2tbNrs[roomAddr][tableId][i];
        // }
        // room2tbNrs[roomAddr][tableId].length = 0;

        for(i = room2tbNrAddr[roomAddr][tableId].length; i > 0; i--) {
            delete room2tbNrAddr[roomAddr][tableId][i - 1];
        }
        room2tbNrAddr[roomAddr][tableId].length = 0;

        emit ResetNotarize(roomAddr, tableId);
    }

    /**
     * @dev 返回table公证者列表
     */
    function getNotaryList(address tbManage,uint256 tableid) public view returns(address[]) {
        return room2tbNrAddr[tbManage][tableid];
    }

    /**
     * @dev 返回table公证者列表
     */
    function getRoomTableNotarys(address roomAddr, uint tableId) public view returns(address[]) {
        return room2tbNrAddr[roomAddr][tableId];
    }

    /**
     * @dev 获取公证者信息
     */
    function getNotaryInfo(address notaryAddr) public view returns(address, string, uint, uint) {
        NotaryMaps.NotaryInfo memory notary = addr2notarys.getValueByKey(notaryAddr);
        return (notary.addr, notary.nodeid, notary.pawnAmount, notary.locktime);
    }

}

